// categorizacion
//- Bajo - gastos son igual o menor al 50% de los ingresos
//- Medio bajo - gastos son mayores al 50% y hasta el 75% de los ingresos
//- Medio alto - gastos son mayores al 75% y hasta un 100% de los ingresos
//- Alto - gastos son mayores 100% de los ingresos
function calculateCategory(income, outcome) {
    let ratio = outcome / income;

    if (ratio <= 0.5) {
        return "Bajo";
    } else if (ratio > 0.5 && ratio <= 0.75) {
        return "Medio bajo";
    } else if (ratio > 0.75 && ratio <= 1) {
        return "Medio alto";
    } else {
        return "Alto";
    }
}

